import './Blog.css'

import { Col, Container, Row } from "react-bootstrap";

import Blog1 from '../MorianImage/blog1.webp';
import Blog2 from '../MorianImage/blog2.webp';
import Blog3 from '../MorianImage/blog3.jpg';

function Blog(){

    const ArraysOfBlog = [{
        id: 1,
        image: Blog1
    },
    {
        id: 2,
        image: Blog2
    },
    {
        id: 3,
        image: Blog3
    }];
    const ArraysOfBlogOnMap = ArraysOfBlog.map((ArrayOfBlog) => 
    <Col xl = "4" lg = "4" md = "4" sm = "6" key = {ArrayOfBlog.id} className = "blog__card">
        <div className = "blog__image">
            <img src = {ArrayOfBlog.image} className = "w-100 h-100"/>
            <span className = "blog__content">
                22 Jul
            </span>
        </div>
    </Col>
    )

    return(
        <div>
            <Container fluid>
                <div class = "blog">
                    <h3 className = "blog__title">Our Blogs</h3>

                    <Row className = "g-1">
                        {ArraysOfBlogOnMap}
                    </Row>
                </div>
            </Container>
        </div>
    )
}

export default Blog
